import logo from './logo.svg';
import './App.css';
import nav from './components/nav';

function App() {
  return (
    <div className="App">


        <p>
          Welcome to the PC Shop
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
